import React from 'react';
import Tournaments from './components/Tournaments'
import SportIcon from './components/SportIcon';

function App() {
  return (
    <div className="App">
      <SportIcon sport="ffootball" selected="true"/>
      <SportIcon sport="ftennis"/>
      <SportIcon sport="fbasketball"/>
      <SportIcon sport="fcricket"/>
      <SportIcon sport="fbaseball"/>
      <SportIcon sport="fhockey"/>
      <SportIcon sport="famerican_football"/>
      <Tournaments />
    </div>
  );
}

export default App;
